import React from "react";
import "./Feature.css";

const Feature = () => {
  return (
    <div>
      <section id="why-us" class="wow fadeIn">
        <div class="container">
          <header class="section-header">
            <h3>Why choose us?</h3>
          </header>
        </div>
      </section>
    </div>
  );
};

export default Feature;
